body:
Background: 
Spartacadabra protocols are about to launch in a day.

This proposal is to allow community to decide what the emission rates of the farming pools will be. The team has done the analysis and wanted to share our proposal. We want the values to be a reasonable range to ensure the protocols are healthy in the long run.

Charm-USDC farming pool on Spookyswap. This is based on assumption of $4M TVL. APR can be higher with less TVL. 

Proposal:
Vote for the emission rate for Charm-USDC pool:

Option 1. 27,106,829 Charm daily.  200% APR (70% emission + 130% protocol fees);
Option 2. 24,396,147 Charm daily.  193% APR (63% emission + 130% protocol fees);
Option 3. 21,685,464 Charm daily.  186% APR (56% emission + 130% protocol fees);
